import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

const LogoutButton = () => {
  const { logout } = useAuth0();

  return (
    <button
      onClick={() => {
        logout();
        localStorage.setItem("role", null);
      }}
      id="qsLoginBtn"
      variant="primary"
      className="ui button"
      style={{ backgroundColor: "rgb(245, 246, 247)" }}
    >
      Logout
    </button>
  );
};

export default LogoutButton;
